import styles from "../styles/index.module.css";
const Introtext = () => {
  return (
    <div>
      <span className={`${styles.underlined} ${styles.underlined}`}>
        Hi, I'm
        <span
          className={`${styles.underlined} ${styles.underlined - backwards}`}
        >
          <i>
            <b>/Niels/</b>
          </i>
          ,
        </span>
        <br />
        And I've recently decided to start my career in the tech space.
        Currently I'm building up my skillset at the
        <span
          className={`${styles.underlined - backwards} ${
            styles.underlined - backwards - reverse
          }`}
        >
          <b>
            <i>Northcoders Developer Pathway</i>
          </b>
        </span>
        in
        <span class="underlined-backwards underlined-backwards--reverse">
          <i>
            <b>{Manchester}</b>
          </i>
        </span>
        . Read more about my starting experience on
        <span class="underlined-backwards underlined-backwards--reverse">
          <a href="#blog">/my blog/.</a>
        </span>
      </span>
    </div>
  );
};

export default Introtext;
